import React from "react";
import withStyles from "@material-ui/core/styles/withStyles";
import clsx from "clsx";
import PropTypes from "prop-types";
import "../assets/css/keyframe.css";
import { styles } from "./styles";

const ScrollLoader = ({ classes, className, color = "secondary" }) => {
    return (
        <div className={clsx(classes.root, className)}>
            <div className={classes.div} color={color}/>
            <div className={classes.div} color={color}/>
            <div className={classes.div} color={color}/>
            <div className={classes.div} color={color}/>
        </div>
    );
};

ScrollLoader.defaultProps = {
    className: ""
};

ScrollLoader.propTypes = {
    classes: PropTypes.object.isRequired,
    className: PropTypes.string
};

export default withStyles(styles, { withTheme: true })(ScrollLoader);
